function drawRuler() {
    clearScreen();
    drawText("++++5+++10+++15+++20+++25+++30+++35+++40+++45+++50+++55+++60", 10, 0, 0);
    for (let i = 2; i < 30; i++) {
        if (i % 5 === 0) {
            drawText("" + i, 10, 0, i - 1);
        } else {
            drawText("+", 10, 0, i - 1);
        }
    }

    // width 56, height 20
}

